import React, { useState, useEffect } from 'react';
import NavBar from '../components/NavBar';
import ApiFacade from './ApiFacade'


export default function LoggedIn(props) {

  const [upcomingMatch, setUpcomingMatches] = useState([])

  useEffect(() => {
    ApiFacade.fetchUpcoming().then(result => {
      setUpcomingMatches(result)
    });
  }, [])

  return (
    <div class="row">

      <div class="col-sm-2 logged-in-left-menu logged-in-col">
        <NavBar logout={props.logout} />
      </div>
      <div class="col col-lg-10 logged-in-right-menu logged-in-col">

        <div class="row match-header-div">
          <div class="col align-self-center">
            <h1 className="upcoming-match-header-1">Schedule</h1>
            <h2 className="upcoming-match-header-2">Upcoming matches</h2>
            <div class="pb-3 mb-0 small lh-sm border-bottom w-100"></div>
          </div>
        </div>


        {upcomingMatch.map((data, i) => {
          return (
            <div>
              <div class="d-flex pt-3 schedule-row">
                <div class="d-flex justify-content-between match-schedule-div">
                  <h1 className="upcoming-match-header-3">{data.team1.acronym}</h1>
                  <img className="upcoming-match-img" src={data.team1.image_url} />
                  <h1 className="upcoming-match-header-3"> Vs.</h1>
                  <img className="upcoming-match-img" src={data.team2.image_url} />
                  <input type="submit" class="fadeIn fourth login-form-btn" value="See match"></input>
                </div>
              </div>
              <svg id="bigTriangleShadow" xmlns="http://www.w3.org/2000/svg" version="1.1" width="100%" height="100" viewBox="0 0 100 100" preserveAspectRatio="none">
                <path id="trianglePath1" d="M0 0 L50 100 L100 0 Z" />
                <path id="trianglePath2" d="m100 100 L100 40 L100 0 Z" />
              </svg>
            </div>
          );
        })}


      </div>
    </div>
  )
}
